import React from 'react';
import { View, SafeAreaView, ImageBackground, TouchableOpacity } from 'react-native';
import { Button, Card, TextInput } from 'react-native-paper';
import { loginStyle } from './loginStyle';

export default  function LoginScreenEt (){
   

        return (
            <ImageBackground
                source={require('../images/backgroundAccueil.jpg')}
                style={{ width: "100%", height: "100%" }}
            >


                <SafeAreaView style={loginStyle.content}>
                    <View style={loginStyle.View}>
                        <Card >
                            <Card.Content>
                                <Card.Title title="Welcome to Learn EZ" titleStyle={loginStyle.cardTitle}></Card.Title>
                                <TextInput label="Login" ></TextInput>
                                <TextInput label="Password" secureTextEntry={true} ></TextInput>
                                <Button mode="contained" onPress={() => this.props.navigation.navigate("Home")}>Login</Button>
                                <Button onPress={() => this.props.navigation.navigate("registerEtd")}>Register</Button>
                            </Card.Content>

                        </Card>
                    </View>
                </SafeAreaView>
            </ImageBackground >

        )
    
}
